import utils from "../styles/utils.module.css";

const Showcase = () => {
  return (
    <section>
      <div className={utils.container}>
        <div>
          
        </div>
       
      </div>
      <style jsx>{`
        section > div {
          display: flex;
          justify-content: center;
          background: yellow;
        }
      `}</style>
    </section>
  );
};

export default Showcase;
